import React from 'react';
import { Button, styled, Stack } from '@mui/material';
import { Link } from "react-router-dom";

const ColorButton = styled(Button)(({ theme }) => ({
    color: 'black',
    font: 'bold',
    fontSize: '1.5rem',
    fontWeight: 'bold',
    fontFamily: 'Bitter',
    '&:hover': {
        background: "cyan",
        variant: 'outlined',
        focusRipple: true,
    },
}));
export function CatButtons() {
    return (
        <>
            <Stack
                direction="row"
                spacing={2}
                alignItems="flex-end">
                <Link to='/author'>
                    <ColorButton>
                        Author
                    </ColorButton>
                </Link>
                <Link to='/random'>
                    <ColorButton>
                        Random
                    </ColorButton>
                </Link>
            </Stack>
        </>
    )
}
export function AuthorButtons() {
    return (
        <>
            <Stack
                direction="row"
                spacing={2}
                alignItems="flex-end">
                <Link to='/random'>
                    <ColorButton>
                        Random
                    </ColorButton>
                </Link>
                <Link to='/category'>
                    <ColorButton>
                        Category
                    </ColorButton>
                </Link>
            </Stack>
        </>
    )
}

export default function NavButtons(from) {
    
